import React from 'react';

export default function CalendarPage() {
  return (
    <div className="space-y-4">
      <div className="bg-white rounded-2xl p-4 border border-rose-100 shadow-sm">
        <h3 className="font-semibold">Calendario</h3>
        <p className="text-gray-600">Aquí podrás añadir eventos con ubicación, duración, aniversarios automáticos y horarios de trabajo/estudio.</p>
        <p className="text-xs text-gray-500 mt-2">Próximamente: integración con Firebase.</p>
      </div>
    </div>
  );
}
